import styled from 'styled-components'

export const Title = styled.h3`
    font-family: 'Gibson-Regular';
    font-size: 36px;
    line-height: 42px;  
    font-weight: 600; 
    margin: 0;
    margin-bottom: 60px;
`

export const Label = styled.h6`
    font-family: 'Gibson-Regular';
    font-size: 16px;
    line-height: 22px;
    font-weight: 400;
    color: #938D84;
    margin: 0;
`
